import React from "react";
import "./style.css";
import {Search, sortButton} from "/"




export const Row  = props => 
<>
<tr>
<td><img src = {props.image} alt = {props.name} /></td>
<td>{props.name}</td>
<td>{props.phone}</td>
<td>{props.email}</td>
<td>{props.dob}</td>
</tr>
</>


function EmployeeTable(props) {
  return (
    <table>
        <tr>
          <th>Image</th>
          <th>Name<sortButton /></th>
          <th>Phone</th>
          <th>Email</th>
          <th>DOB</th>
        </tr>
        {props.employees.map(person => (
            <Row {...person}/>
        ))}

    </table>
  );
}

export default EmployeeTable;
